import {changeTodoCompleted, fetchTodo, changeTodoDescriptionUpdate, changeTodoResponsibleUpdate, changeTodoPriorityUpdate} from '../actions/editTodo.actions';

const editTodoContainer = {
    mapStateToProps: state => ({
        todoPriority: state.editTodo.todoPriority,
        todoDescription: state.editTodo.todoDescription,
        todoResponsible: state.editTodo.todoResponsible,
        todoCompleted: state.editTodo.todoCompleted,
    }),
    mapDispatchToProps: dispatch => ({
            changeTodoDescription: (event) => dispatch(changeTodoDescriptionUpdate(event)),
            changeTodoResponsible: (event) => dispatch(changeTodoResponsibleUpdate(event)),
            changeTodoPriority: (event) => dispatch(changeTodoPriorityUpdate(event)),
            changeTodoCompleted: (event) => dispatch(changeTodoCompleted(event)),
            fetchTodo: (id) => dispatch(fetchTodo(id)),
            update: () => dispatch({type: 'update'}),
    })
}

export default editTodoContainer;
